  document.body.classList.add("bg-stone-300", "dark:bg-zinc-950");
  return (
    <div>
      <div class="mt-1/2 flex items-center">
          <img class="rounded-full mr-5" src={photo} height="140" width="140"></img>
        <p class="text-6xl font-mono font-bold text-black dark:text-white">Neil Purohit</p>
      </div>
      <Theme/>
      <h2 class="text-white">hi</h2>
    </div>
  );
}
